import React from 'react';
import { Route, IndexRoute, Redirect } from 'react-router';

import ProductsContainer from './components/ProductsSpace/ProductSpace';
import AppC from './components/AppContainer';

const MAIN_WORKSPACE = '/promotion';

export default (
    <div>
    <Route path="/" component={AppC}>,
        <Route path='/products/:variable' component={ProductsContainer} />
    </Route>
    </div>
);
